  font-family: "Poppins", sans-serif;
  font-size: var(--font-size-xs, 11px);
  font-style: normal;
  font-weight: bold;
  line-height: 1.6;
  text-transform: uppercase;
  letter-spacing: 1.2px;
}

/**
 * Page title
 */

.o-page-title {
  text-align: center;
  padding: 0;
  padding-right: 0;
}

/**
 * Intro
 */

.o-intro,
.o-intro p {
  font-size: var(--font-size-l, 24px);
  line-height: 1.6;
}

/**
 * Kicker
 */

.o-kicker {
  font-family: "Poppins", sans-serif;
  font-size: var(--font-size-m, 16px);
  font-style: normal;
  font-weight: 600;
  line-height: 1.6;
  text-transform: uppercase;
  letter-spacing: 1px;
  font-weight: bold;
  color: #f33f4b;
}

/**
 * Rich text editor text
 */

.o-rte-text {
  width: 100%;
  max-width: 100%;
  margin-left: auto;
  margin-right: auto;
  line-height: 1.5;
  font-family: "Nunito", sans-serif;
  font-size: var(--body-font-size, 18px);
}

@media print {
  .o-rte-text {
    font-size: 12px;
    line-height: 1.3;
  }
}

.o-rte-text > * + * {
  margin-top: 20px;
}

.o-rte-text > *:not(.o-section) {
  max-width: 850px;
  margin-left: auto;
  margin-right: auto;
}

.o-rte-text > dl dd,
.o-rte-text > dl dt,
.o-rte-text > ol li,
.o-rte-text > ul li,
.o-rte-text > p {
  line-height: 1.5;
  font-family: "Nunito", sans-serif;
  font-size: var(--body-font-size, 18px);
}

@media print {
  .o-rte-text > dl dd,
  .o-rte-text > dl dt,
  .o-rte-text > ol li,
  .o-rte-text > ul li,
  .o-rte-text > p {
    font-size: 12px;
    line-height: 1.3;
  }
}

.o-rte-text h2:empty,
.o-rte-text h3:empty,
.o-rte-text p:empty {
  display: none;
}

.o-rte-text > h1,
.o-rte-text > h2,
.o-rte-text > h3 {
  padding-top: 20px;
}

.o-rte-text > h4 {
  margin-bottom: -10px;
}

.o-rte-text .wp-block-buttons.aligncenter .wp-block-button {
  width: 100%;
  margin-left: auto;
  margin-right: auto;
}

.o-rte-text .wp-block-button__link {
  font-family: "Poppins", sans-serif;
  font-size: var(--font-size-xs, 11px);
  font-style: normal;
  font-weight: bold;
  line-height: 1.6;
  text-transform: uppercase;
  letter-spacing: 1.2px;
  display: inline-flex;
  position: relative;
  justify-content: center;
  align-items: center;
  transition: all 0.4s cubic-bezier(0.86, 0, 0.07, 1);
  text-decoration: none;
  border: 2px solid;
  border-radius: 40px;
  text-align: center;
  line-height: 1;
  white-space: nowrap;
  appearance: none;
  cursor: pointer;
  padding: 10px 20px;
  text-transform: uppercase;
  outline: 0;
  color: #fff;
  background: linear-gradient(-250deg, #5b90bf 50%, #f33f4b 50%);
  background-size: 200% 100%;
  background-position: right bottom;
  border-color: #f33f4b;
}

@media (min-width: 701px) {
  .o-rte-text .wp-block-button__link {
    padding: 15px 40px;
    font-size: var(--font-size-s, 14px);
  }
}

.o-rte-text .wp-block-button__link:hover,
.o-rte-text .wp-block-button__link:focus {
  color: #fff;
  border-color: #5b90bf;
  background-position: left bottom;
}

.o-rte-text hr {
  margin-top: 40px;
  margin-bottom: 40px;
}

.o-rte-text hr.o-hr--small {
  margin-top: 20px;
  margin-bottom: 20px;
}

.o-rte-text code,
.o-rte-text pre {
  font-size: 125%;
}

label,
.o-form div.wpforms-container-full .wpforms-form .wpforms-field-label,
div.wpforms-container-full .wpforms-form .wpforms-field-label {
  font-family: "Poppins", sans-serif;
  font-size: var(--font-size-xs, 11px);
  font-style: normal;
  font-weight: bold;
  line-height: 1.6;
  text-transform: uppercase;
  letter-spacing: 1.2px;
}

/* ------------------------------------ *\
    $SPECIFIC FORMS
\* ------------------------------------ */

/* Social Links */

.c-social-links {
  display: flex;
  align-items: center;
  justify-content: center;
}

.c-social-links__item {
  padding: 10px;
  border-radius: 40px;
  margin: 0 10px;
  background-color: #f33f4b;
}

.c-social-links__item svg path {
  transition: all 0.4s cubic-bezier(0.86, 0, 0.07, 1);
  fill: #fff;
}

/* ------------------------------------ *\
    $NAVIGATION
\* ------------------------------------ */

/**
 * Drawer menu
 */

body.menu-is-active {
  overflow: hidden;
}

body.menu-is-active::before {
  opacity: 1;
  visibility: visible;
  z-index: 9998;
}

@media (min-width: 1001px) {
  body.menu-is-active::before {
    opacity: 0;
    visibility: hidden;
  }
}

body.menu-is-active .c-nav-drawer {
  right: 0;
}

.c-nav-drawer {
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  width: 100vw;
  height: 100vh;
  background-color: #fff;
  position: fixed;
  z-index: 9999;
  top: 0;
  right: -100vw;
  transition: right 0.25s cubic-bezier(0.86, 0, 0.07, 1);
}

@media (min-width: 551px) {
  .c-nav-drawer {
    width: 100%;
    max-width: 400px;
    right: -400px;
  }
}

@media (min-width: 1001px) {
  .c-nav-drawer {
    display: none;
  }
}

.c-nav-drawer__toggle {
  background-color: transparent;
  justify-content: flex-start;
  padding: 20px;
  outline: 0;
  border: 0;
  border-radius: 0;
  background-image: none;
}

.c-nav-drawer__toggle .o-icon {
  transition: transform 0.25s cubic-bezier(0.86, 0, 0.07, 1);
  transform: scale(1);
}

.c-nav-drawer__toggle:hover .o-icon,
.c-nav-drawer__toggle:focus .o-icon {
  transform: scale(1.1);
}

.c-nav-drawer__nav {
  height: 100%;
  padding-top: 40px;
}

.c-nav-drawer__social {
  border-top: 1px solid #f3f3f3;
}

.c-nav-drawer__social .c-social-links {
  justify-content: space-evenly;
}

.c-nav-drawer__social .c-social-links__item {
  border: 0;
  border-radius: 0;
  background: none;
  margin: 0;
}

.c-nav-drawer__social .c-social-links__item svg path {
  fill: #adadad;
}

.c-nav-drawer__social .c-social-links__item:hover svg path,
.c-nav-drawer__social .c-social-links__item:focus svg path {
  fill: #f33f4b;
}

/**
 * Primary nav
 */

.c-nav-primary__menu-item {
  margin: 0 40px;
}

@media (min-width: 1001px) {
  .c-nav-primary__menu-item {
    margin: 0 20px;
  }

  .c-nav-primary__menu-item:last-child {
    margin-right: 0;
  }
}

.c-nav-primary__list {
  display: flex;
  flex-direction: column;
  align-items: stretch;
  justify-content: flex-start;
}

@media (min-width: 1001px) {
  .c-nav-primary__list {
    flex-direction: row;
    align-items: center;
    justify-content: flex-end;
  }
}

.c-nav-primary__menu-item:not(.button) a {
  width: 100%;
  padding: 20px 0;
  border-bottom: 1px solid #f3f3f3;
  color: #000;
  display: flex;
  align-items: center;
  justify-content: space-between;
  font-family: "Poppins", sans-serif;
  font-size: var(--font-size-s, 14px);
  font-style: normal;
  font-weight: 500;
  line-height: 1.6;
  text-transform: uppercase;
  letter-spacing: 1px;
}

@media (min-width: 1001px) {
  .c-nav-primary__menu-item:not(.button) a {
    width: 100%;
    padding: 5px 0;
    display: flex;
    align-items: center;
    justify-content: space-between;
    color: #000;
    border-bottom: 1px solid transparent;
    text-align: center;
  }
}

.c-nav-primary__menu-item:not(.button) a:hover,
.c-nav-primary__menu-item:not(.button) a:focus {
  color: #000;
}

@media (min-width: 1001px) {
  .c-nav-primary__menu-item:not(.button) a:hover,
  .c-nav-primary__menu-item:not(.button) a:focus {
    border-bottom: 1px solid #000;
  }
}

.c-nav-primary__menu-item:not(.button) a:hover::after,
.c-nav-primary__menu-item:not(.button) a:focus::after {
  opacity: 1;
  visibility: visible;
  left: 0;
}

.c-nav-primary__menu-item:not(.button) a::after {
  opacity: 0;
  visibility: hidden;
  content: "→";
  color: #adadad;
  font-size: 22px;
  line-height: 1;
  transition: all 0.4s cubic-bezier(0.86, 0, 0.07, 1);
  position: relative;
  left: -10px;
  transition-delay: 0.25s;
}

@media (min-width: 1001px) {
  .c-nav-primary__menu-item:not(.button) a::after {
    display: none;
  }
}

.c-nav-primary__menu-item.button a {
  font-family: "Poppins", sans-serif;
  font-size: var(--font-size-xs, 11px);
  font-style: normal;
  font-weight: bold;
  line-height: 1.6;
  text-transform: uppercase;
  letter-spacing: 1.2px;
  display: inline-flex;
  position: relative;
  justify-content: center;
  align-items: center;
  transition: all 0.4s cubic-bezier(0.86, 0, 0.07, 1);
  text-decoration: none;
  border: 2px solid;
  border-radius: 40px;
  text-align: center;
  line-height: 1;
  white-space: nowrap;
  appearance: none;
  cursor: pointer;
  padding: 10px 20px;
  text-transform: uppercase;
  outline: 0;
  color: #fff;
  background: linear-gradient(to left, #5b90bf 50%, #f33f4b 50%);
  background-size: 200% 100%;
  background-position: right bottom;
  border-color: #5b90bf;
}

@media (min-width: 701px) {
  .c-nav-primary__menu-item.button a {
    padding: 15px 40px;
    font-size: var(--font-size-s, 14px);
  }
}

.c-nav-primary__menu-item.button a:hover,
.c-nav-primary__menu-item.button a:focus {
  color: #fff;
  border-color: #f33f4b;
  background-position: left bottom;
}

@media (max-width: 1000px) {
  .c-nav-primary__menu-item.button a {
    margin-top: 20px;
    width: 100%;
  }
}

.c-nav-primary__menu-item.button a::after {
  display: none;
}

/**
 * Utility nav
 */

.c-nav-utility {
  display: flex;
  flex-direction: column;
  align-items: stretch;
  justify-content: stretch;
  margin: 40px;
}

@media (min-width: 701px) {
  .c-nav-utility {
    flex-direction: row;
    align-items: center;
    justify-content: flex-end;
    margin: 0 -10px;
  }
}

.c-nav-utility__link {
  font-family: "Poppins", sans-serif;
  font-size: var(--font-size-xs, 11px);
  font-style: normal;
  font-weight: bold;
  line-height: 1.6;
  text-transform: uppercase;
  letter-spacing: 1.2px;
  color: #f33f4b;
  padding: 10px 0;
  position: relative;
}

@media (min-width: 701px) {
  .c-nav-utility__link {
    color: #fff;
    padding: 0 10px;
    height: 100%;
    line-height: 40px;
  }
}

.c-nav-utility__link:hover,
.c-nav-utility__link:focus {
  color: #000;
}

@media (min-width: 701px) {
  .c-nav-utility__link:hover,
  .c-nav-utility__link:focus {
    color: #fff;
  }

  .c-nav-utility__link:hover::after,
  .c-nav-utility__link:focus::after {
    background-color: #5b90bf;
  }
}

.c-nav-utility__link::after {
  content: "";
  display: block;
  width: 100%;
  height: 100%;
  background-color: transparent;
  position: absolute;
  top: 0;
  left: 0;
  z-index: -1;
  transform: skewX(-20deg);
  transition: all 0.4s cubic-bezier(0.86, 0, 0.07, 1);
  pointer-events: none;
}

/**
 * Footer nav
 */

.c-nav-footer {
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  align-items: center;
  justify-content: center;
  text-align: center;
  margin-bottom: -10px;
}

.c-nav-footer__link {
  color: #fff;
  padding: 10px;
  border-radius: 50px;
  font-family: "Poppins", sans-serif;
  font-size: var(--font-size-xs, 11px);
  font-style: normal;
  font-weight: bold;
  line-height: 1.6;
  text-transform: uppercase;
  letter-spacing: 1.2px;
}

.c-nav-footer__link:hover,
.c-nav-footer__link:focus {
  color: #fff;
  background-color: #f33f4b;
}

/**
 * Footer legal nav
 */

.c-nav-footer-legal {
  display: flex;
  align-items: center;
  justify-content: center;
  margin-left: -10px;
  margin-right: -10px;
}

@media (min-width: 701px) {
  .c-nav-footer-legal {
    justify-content: flex-end;
  }
}

.c-nav-footer-legal__link {
  color: #fff;
  padding: 5px 10px;
  text-decoration: underline;
}

.c-nav-footer-legal__link:hover,
.c-nav-footer-legal__link:focus {
  color: #fff;
}

/* ------------------------------------ *\
    $CONTENT
\* ------------------------------------ */

.c-content > .o-page-title {
  margin-top: 40px;
  margin-bottom: 40px;
}

/* ------------------------------------ *\
    $HEADER
\* ------------------------------------ */

#wpadminbar {
  position: fixed;
  z-index: 10;
}

#wpadminbar #wp-admin-bar-root-default #wp-admin-bar-customize,
#wpadminbar #wp-admin-bar-root-default #wp-admin-bar-comments,
#wpadminbar #wp-admin-bar-root-default #wp-admin-bar-wpseo-menu {
  display: none;
}

.logged-in .c-utility {
  top: 0;
}

@media (min-width: 783px) {
  .logged-in .c-utility {
    top: 32px;
  }
}

.c-utility {
  position: relative;
  top: 0;
  z-index: 9;
  height: 40px;
  background: #f33f4b;
}

@media (min-width: 701px) {
  .c-utility {
    position: sticky;
  }
}

.c-utility--inner {
  display: flex;
  align-items: stretch;
  justify-content: space-between;
}

@media (max-width: 700px) {
  .c-utility__nav {
    display: none;
  }
}

.c-utility__social {
  position: relative;
  left: -10px;
}

.c-utility__social a {
  border: 0;
  border-radius: 0;
  background: none;
  margin: 0;
}

.c-utility__social a svg path {
  fill: #fff;
}

.c-utility__social a:hover,
.c-utility__social a:focus {
  background-color: #5b90bf;
}

.c-utility__social a:hover svg path,
.c-utility__social a:focus svg path {
  fill: #fff;
}

.c-header {
  border-bottom: 1px solid #f3f3f3;
  background-color: #fff;
}

.c-header--inner {
  display: flex;
  align-items: center;
  justify-content: space-between;
}

.c-header__logo {
  display: flex;
  align-items: center;
  max-width: 240px;
  padding: 20px 0;
}

.c-header__logo img {
  width: 100%;
}

.c-header__nav {
  display: flex;
  align-items: center;
  justify-content: center;
}

.c-header__nav .c-nav-primary {
  display: none;
}

@media (min-width: 1001px) {
  .c-header__nav .c-nav-primary {
    display: flex;
  }
}

.c-header__nav .o-toggle {
  border-radius: 0;
  background: none;
  border: 0;
  position: relative;
  right: -20px;
  padding: 20px;
}

@media (min-width: 1001px) {
  .c-header__nav .o-toggle {
    display: none;
  }
}

/* ------------------------------------ *\
    $FOOTER
\* ------------------------------------ */

.c-footer {
  position: relative;
  z-index: 1;
  background-color: #5b90bf;
  font-weight: bold;
  margin-top: 80px;
}

.c-footer-main {
  padding: 40px 0;
}

.c-footer-main__contact a {
  color: #000;
}

.c-footer-main__contact a:hover,
.c-footer-main__contact a:focus {
  text-decoration: underline;
}

.c-footer-legal {
  background-color: #f33f4b;
  color: #fff;
  width: 100%;
  font-size: var(--font-size-xs, 11px);
}

.c-footer-legal .c-footer--inner {
  padding: 5px 20px;
  grid-row-gap: 0;
}

.c-footer-legal__copyright {
  text-align: center;
}

@media (min-width: 701px) {
  .c-footer-legal__copyright {
    text-align: left;
  }
}

@media (min-width: 701px) {
  .c-footer-legal__nav {
    text-align: right;
  }
}

/* ------------------------------------ *\
    $PAGE SECTIONS
\* ------------------------------------ */

.o-section {
  padding-top: 40px;
  padding-bottom: 40px;
  margin-left: -20px;
  margin-right: -20px;
}

@media (min-width: 701px) {
  .o-section {
    padding-top: 80px;
    padding-bottom: 80px;
  }
}

@media (min-width: 1001px) {
  .o-section {
    margin-left: -40px;
    margin-right: -40px;
  }
}

.o-section:first-child {
  padding-top: 0;
}

/**
 * Hero
 */

.c-section-hero {
  position: relative;
  overflow: hidden;
  margin-top: 0;
  margin-bottom: 40px;
}

@media (min-width: 701px) {
  .c-section-hero {
    margin-bottom: 80px;
  }
}

@media (max-width: 700px) {
  .c-section-hero--inner {
    grid-column-gap: 0;
  }
}

.c-section-hero::before {
  content: "";
  position: absolute;
  top: 0;
  bottom: 0;
  left: 0;
  width: 100%;
  transform: skew(-35deg);
  transform-origin: top;
  background-color: rgba(91, 144, 191, 0.2);
}

.c-section-hero.o-section {
  padding-top: 80px;
}

.c-section-hero__body {
  display: flex;
  flex-direction: column;
  justify-content: center;
}

.c-section-hero__button {
  align-self: flex-start;
}

.c-section-hero__image {
  display: block;
  width: 100%;
  height: auto;
  position: relative;
}

.c-section-hero__image img {
  box-shadow: 0px 8px 24px rgba(0, 0, 0, 0.2);
  width: 100%;
  height: auto;
}

.c-section-hero__image svg {
  max-width: 400px;
  margin-left: auto;
  margin-right: auto;
  width: 100%;
  height: auto;
}

/**
 * Banner
 */

.c-section-banner {
  padding-left: 20px;
  padding-right: 20px;
  position: relative;
}

.c-section-banner--inner {
  background-color: rgba(91, 144, 191, 0.2);
  border-radius: 50px;
  padding: 40px;
}

@media (max-width: 700px) {
  .c-section-banner--inner {
    grid-column-gap: 0;
  }
}

@media (min-width: 851px) {
  .c-section-banner--inner {
    border-radius: 100px;
  }
}

.c-section-banner__body {
  display: flex;
  flex-direction: column;
  justify-content: center;
  padding-top: 20px;
}

@media (min-width: 851px) {
  .c-section-banner__body {
    padding-bottom: 20px;
  }
}

.c-section-banner__button {
  align-self: flex-start;
}

.c-section-banner__image {
  position: relative;
  height: auto;
  display: block;
  align-self: center;
  justify-content: flex-end;
}

@media (max-width: 1200px) {
  .c-section-banner__image {
    transform: scale(0.8) !important;
  }
}

@media (min-width: 851px) {
  .c-section-banner__image {
    left: calc(50% + 80px);
    position: absolute;
    top: 0;
  }
}

@media (min-width: 1201px) {
  .c-section-banner__image {
    transform: scale(1);
    right: -160px;
    left: auto;
  }
}

.c-section-banner__image picture {
  border-radius: 50%;
  overflow: hidden;
  z-index: 1;
  position: relative;
  border: 5vw solid #f33f4b;
  width: 75%;
  height: 75%;
  margin-left: auto;
  margin-right: auto;
}

@media (min-width: 851px) {
  .c-section-banner__image picture {
    width: 600px;
    height: 600px;
    min-width: 600px;
    margin-left: 0;
    border-width: 40px;
  }
}

.c-section-banner__image::before {
  content: "";
  display: none;
  background-color: #f33f4b;
  height: 100%;
  width: 50vw;
  position: absolute;
  left: 50%;
  top: 0;
  z-index: 0;
}

@media (min-width: 851px) {
  .c-section-banner__image::before {
    display: none;
  }
}

.c-section-banner__image::after {
  content: "";
  display: block;
  height: 100%;
  width: 100%;
  position: absolute;
  z-index: 0;
  border-left: 50vw solid transparent;
