","/* ------------------------------------ *\
    $TABLES
\* ------------------------------------ */

table {
  border-spacing: 0;
  border: $border--standard-light;
  border-radius: $border-radius;
  overflow: hidden;
  width: 100%;

  label {
    font-size: $body-font-size;
  }
}

th {
  text-align: left;
  border: 1px solid transparent;
  padding: $space-half 0;
  vertical-align: top;
  font-weight: bold;
}

tr {
  border: 1px solid transparent;
}

th,
td {
  border: 1px solid transparent;
  padding: $space-half;
  border-bottom: $border--standard-light;
}

thead th {
  background-color: $c-gray--lighter;

  @include o-heading--xs;
}

tfoot th {
  @include p;

  text-transform: none;
  letter-spacing: normal;
  font-weight: bold;
}

/**
 * Responsive Table
 */
.c-table--responsive {
  border-collapse: collapse;
  border-radius: $border-radius;
  padding: 0;
  width: 100%;

  th {
    background-color: $c-gray--lighter;
  }

  th,
  td {
    padding: $space-half;
    border-bottom: $border--standard-light;
  }

  @include media("<=medium") {
    border: 0;

    thead {
      border: none;
      clip: rect(0 0 0 0);
      height: 1px;
      margin: -1px;
      overflow: hidden;
      padding: 0;
      position: absolute;
      width: 1px;
    }

    tr {
      display: block;
      margin-bottom: $space / 2;
      border: 1px solid $c-gray--light;
      border-radius: $border-radius;
      overflow: hidden;

      &.this-is-active {
        td:not(:first-child) {
          display: flex;
        }

        td:first-child::before {
          content: "- " attr(data-label);
        }
      }
    }

    th,
    td {
      border-bottom: 1px solid $c-white;
      background-color: $c-gray--lighter;
    }

    td {
      border-bottom: $border--standard-light;
      display: flex;
      align-items: center;
      justify-content: space-between;
      min-height: 40px;
      text-align: right;

      &:first-child {
        cursor: pointer;
        background-color: $c-gray--lighter;

        &::before {
          content: "+ " attr(data-label);
        }
      }

      &:last-child {
        border-bottom: 0;
      }

      &:not(:first-child) {
        display: none;
        margin: 0 $space-half;
        background-color: $c-white;
      }

      &::before {
        content: attr(data-label);
        font-weight: bold;
        text-transform: uppercase;
        font-size: $font-size-xs;
      }
    }
  }
}
","/* ------------------------------------ *\
    $BUTTONS
\* ------------------------------------ */

@mixin o-button {
  @include o-heading--xs;

  display: inline-flex;
  position: relative;
  justify-content: center;
  align-items: center;
  transition: $transition-all;
  text-decoration: none;
  border: 2px solid;
  border-radius: 40px;
  text-align: center;
  line-height: 1;
  white-space: nowrap;
  appearance: none;
  cursor: pointer;
  padding: $space-half $space;
  text-transform: uppercase;
  outline: 0;

  @include media('>medium') {
    padding: 15px $space-double;
    font-size: $font-size-s;
  }
}

/**
 * Button Primary
 */
@mixin o-button--primary {
  color: $c-white;
  background: linear-gradient(-250deg, $c-secondary 50%, $c-primary 50%);
  background-size: 200% 100%;
  background-position: right bottom;
  border-color: $c-primary;

  &:hover,
  &:focus {
    color: $c-white;
    border-color: $c-secondary;
    background-position: left bottom;
  }
}

.o-button--primary {
  @include o-button;
  @include o-button--primary;
}

/**
 * Button Secondary
 */
@mixin o-button--secondary {
  color: $c-white;
  background: linear-gradient(to left, $c-secondary 50%, $c-primary 50%);
  background-size: 200% 100%;
  background-position: right bottom;
  border-color: $c-secondary;

  &:hover,
  &:focus {
    color: $c-white;
    border-color: $c-primary;
    background-position: left bottom;
  }
}

div.wpforms-container .wpforms-form .wpforms-page-button,
.o-button--secondary {
  @include o-button;
  @include o-button--secondary;
}

/**
 * Button Tertiary
 */
@mixin o-button--teritary {
  color: $c-primary;
  background: linear-gradient(to left, transparent 50%, $c-primary 50%);
  background-size: 200% 100%;
  background-position: right bottom;

  &:hover,
  &:focus {
    color: $c-white;
    border-color: $c-primary;
    background-position: left bottom;
  }
}

.o-button--teritary {
  @include o-button;
  @include o-button--teritary;
}


button,
input[type="submit"],
.o-button,
.o-form div.wpforms-container .wpforms-form button[type=submit],
div.wpforms-container .wpforms-form button[type=submit] {
  @include o-button;
  @include o-button--primary;
}
