/**
 * Banner
 */
.c-section-banner {
  padding-left: $space;
  padding-right: $space;
  position: relative;

  &--inner {
    background-color: rgba($c-secondary, 0.2);
    border-radius: 50px;
    padding: $space-double;

    @include media("<=medium") {
      grid-column-gap: 0;
    }

    @include media(">large") {
      border-radius: 100px;
    }
  }

  &__body {
    display: flex;
    flex-direction: column;
