      left: calc(50% + #{$space-quad});
      position: absolute;
      top: 0;
    }


    @include media(">xxlarge") {
      transform: scale(1);
      right: -160px;
      left: auto;
    }


    picture {
      border-radius: 50%;
      overflow: hidden;
      z-index: 1;
      position: relative;
      border: 5vw solid $c-primary;
      width: 75%;
      height: 75%;
      margin-left: auto;
      margin-right: auto;

      @include media(">large") {
        width: 600px;
        height: 600px;
        min-width: 600px;
        margin-left: 0;
        border-width: 40px;
      }
    }

    &::before {
      content: "";
      display: none;
      background-color: $c-primary;
      height: 100%;
      width: 50vw;
      position: absolute;
      left: 50%;
      top: 0;
      z-index: 0;

      @include media(">large") {
        display: none;
      }
    }

    &::after {
      content: "";
      display: block;
      height: 100%;
      width: 100%;
      position: absolute;
      z-index: 0;
      border-left: 50vw solid transparent;
      border-right: 50vw solid transparent;
      border-top: 60vw solid $c-primary;
      transform: translate(-50%, 0);
      left: 50%;
      top: 50%;

      @include media(">large") {
        border-top: 400px solid transparent;
        border-bottom: 400px solid transparent;
        border-right: 460px solid $c-primary;
        border-left: none;
        transform: translate(0, -50%);
        left: -50%;
        top: 50%;
      }
    }
  }
}

/**
 * Cards
 */
.c-section-cards {
  &__buttons {
    display: flex;
    align-items: center;
    justify-content: center;

    a {
      margin: 0 $space-half;
    }

    a:last-child {
      @include o-button--teritary;
    }
  }

  .c-cards {
    grid-column-gap: 0;

    @include media(">medium") {
      grid-column-gap: $space-double;
    }
  }

  .c-card {
    display: flex;
    align-items: center;
    flex-direction: column;
    background-color: $c-white;
    border-radius: $border-radius--large;
    padding: $space;
    text-align: center;

    picture {
      display: block;
      overflow: hidden;
      border-radius: 50%;
    }

    &__description {
      flex: 1;
    }
  }
}

